// BITS_PER_DSP
static int dev_gpo_set(lldev_t dev, unsigned bank, unsigned data)
{
    return lowlevel_reg_wr32(dev, 0, 0, ((bank & 0x7f) << 24) | (data & 0xff));
}

int fgearbox_load_ucode(lldev_t dev, unsigned gport, const uint8_t* ucode)
{
    int res;
    for (unsigned i = 0; i < UCODE_SIZE; i++) {
        res = dev_gpo_set(dev, gport, ucode[i]);
        if (res)
            return res;
    }
    return 0;
}


int fgearbox_load_fir(lldev_t dev, unsigned gport, fgearbox_firs_t fir)
{
    const uint8_t* s_st8_dsp;

    switch (fir) {
    case FGBOX_X2:
        s_st8_dsp = fir_data_dec2_clkr2;
        break;
    case FGBOX_X3:
        s_st8_dsp = fir_data_dec3_clkr2;
        break;
    case FGBOX_X4:
        s_st8_dsp = fir_data_dec4_clkr2;
        break;
    case FGBOX_X5:
        s_st8_dsp = fir_data_dec5_clkr2;
        break;
    case FGBOX_X6:
        s_st8_dsp = fir_data_dec6_clkr2;
        break;
    case FGBOX_X8:
        s_st8_dsp = fir_data_dec8_clkr2;
        break;
    case FGBOX_X16:
        s_st8_dsp = fir_data_dec16_clkr2;
        break;
    case FGBOX_X32:
        s_st8_dsp = fir_data_dec32_clkr2;
        break;
    case FGBOX_X64:
        s_st8_dsp = fir_data_dec64_clkr2;
        break;
    case FGBOX_X128:
        s_st8_dsp = fir_data_dec128_clkr2;
        break;

    default:
        return -EINVAL;
    }

    return fgearbox_load_ucode(dev, gport, s_st8_dsp);
}







